import './App.css';
import Navbar from './Components/Navbar/Navbar';
import Content from './Components/Content/Content';
import BrowserRouter from 'react-router-dom';
import { Container } from 'react-bootstrap';

function App() {
  return (
      <Container>
        <BrowserRouter>
        <Navbar/>
        <Content/>
        </BrowserRouter>
      </Container>
  );
}

export default App;
